\n\n<p>与流行的看法相反，Lorem Ipsum 不仅仅是随机文本。 它源于公元前 45 年的一段古典拉丁文学，已有 2000 多年的历史。 弗吉尼亚州汉普登-悉尼学院的拉丁语教授理查德麦克林托克从 Lorem Ipsum 的一篇文章中查找了一个较为晦涩的拉丁词 consectetur，并通过在古典文学中对该词的引用，发现了无可置疑的来源。 Lorem Ipsum 来自“de Finibus Bonorum et Malorum”的第 1.10.32 和 1.10.33 节。 (The Extremes of Good and Evil) by Cicero，写于公元前 45 年。 这本书是关于伦理学理论的论文，在文艺复兴时期非常流行。 Lorem Ipsum 的第一行“Lorem ipsum dolor sat amet..”来自第 1.10.32 节中的一行。</p>\n\n<p>&nbsp;</p>","second","Active","ch","3","2021-12-03 20:14:51","2021-12-03 20:14:51");
