\n\n<div class=\"cancellation_policy\">\n<p>&nbsp;</p>\n\n<p>Buy2rental allows hosts to choose among three standardized cancellation policies (Flexible, Moderate, and Strict) that we will enforce to protect both guest and host alike. Each listing and reservation on our site will clearly state the cancellation policy. Guests may cancel and review any penalties by viewing their travel plans and then clicking &#39;Cancel&#39; on the appropriate reservation.</p>\n\n<p>&nbsp;</p>\n\n<h3><strong>Flexible: Full refund 1 day prior to arrival, except fees</strong></h3>\n\n<ul>\n	<li>Cleaning fees are always refunded if the guest did not check in.</li>\n	<li>The Buy2rental service fee is non-refundable.</li>\n	<li>If there is a complaint from either party, notice must be given to Buy2rental within 24 hours of check-in.</li>\n	<li>Buy2rental will mediate when necessary, and has the final say in all disputes.</li>\n	<li>A reservation is officially canceled when the guest clicks the cancellation button on the cancellation confirmation page, which they can find in Dashboard &gt; Your Trips &gt; Change or Cancel.</li>\n	<li>Cancellation policies may be superseded by the Guest Refund Policy, safety cancellations, or extenuating circumstances. Please review these exceptions.</li>\n	<li>Applicable taxes will be retained and remitted.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>Moderate: Full refund 5 days prior to arrival, except fees</strong></h3>\n\n<ul>\n	<li>Cleaning fees are always refunded if the guest did not check in.</li>\n	<li>The Buy2rental service fee is non-refundable.</li>\n	<li>If there is a complaint from either party, notice must be given to Buy2rental&nbsp;within 24 hours of check-in.</li>\n	<li>Buy2rental will mediate when necessary, and has the final say in all disputes.</li>\n	<li>A reservation is officially canceled when the guest clicks the cancellation button on the cancellation confirmation page, which they can find in Dashboard &gt; Your Trips &gt; Change or Cancel.</li>\n	<li>Cancellation policies may be superseded by the Guest Refund Policy, safety cancellations, or extenuating circumstances. Please review these exceptions.</li>\n	<li>Applicable taxes will be retained and remitted.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>Strict: 50% refund up until 1 week prior to arrival, except fees</strong></h3>\n\n<ul>\n	<li>Cleaning fees are always refunded if the guest did not check in.</li>\n	<li>The Buy2rental service fee is non-refundable.</li>\n	<li>If there is a complaint from either party, notice must be given to Buy2rental within 24 hours of check-in.</li>\n	<li>Buy2rental will mediate when necessary, and has the final say in all disputes.</li>\n	<li>A reservation is officially canceled when the guest clicks the cancellation button on the cancellation confirmation page, which they can find in Dashboard &gt; Your Trips &gt; Change or Cancel.</li>\n	<li>Cancellation policies may be superseded by the Guest Refund Policy, safety cancellations, or extenuating circumstances. Please review these exceptions.</li>\n	<li>Applicable taxes will be retained and remitted.</li>\n</ul>\n</div>","second","Active","en","1","2021-12-07 01:28:56","2021-12-07 01:42:02");
