\n\n<div class=\"cancellation_policy\">\n<p>&nbsp;</p>\n\n<p>Buy2rental permet aux hôtes de choisir parmi trois politiques d\'annulation standardisées (flexible, modérée et stricte) que nous appliquerons pour protéger à la fois l\'invité et l\'hôte. Chaque annonce et réservation sur notre site indiquera clairement la politique d\'annulation. Les voyageurs peuvent annuler et revoir les pénalités en consultant leurs projets de voyage, puis en cliquant sur « Annuler ». sur la réservation appropriée.</p>\n\n<p>&nbsp;</p>\n\n<h3><strong>Flexible : Remboursement intégral 1 jour avant la date d\'arrivée, hors frais</strong></h3>\n\n<ul>\n<li>Les frais de ménage sont toujours remboursés si le client ne s\'est pas enregistré.</li>\n<li>Les frais de service Buy2rental ne sont pas remboursables.</li>\n<li>S\'il y a une plainte de l\'une ou l\'autre des parties, un avis doit être donné à Buy2rental dans les 24 heures suivant l\'enregistrement.</li>\n<li>Buy2rental arbitrera si nécessaire et aura le dernier mot dans tous les litiges.</li>\n<li>Une réservation est officiellement annulée lorsque le client clique sur le bouton d\'annulation sur la page de confirmation d\'annulation, qu\'il peut trouver dans le tableau de bord &gt ; Vos voyages &gt; Modifier ou annuler.</li>\n<li>Les politiques d\'annulation peuvent être remplacées par la politique de remboursement des invités, les annulations de sécurité ou des circonstances atténuantes. Veuillez consulter ces exceptions.</li>\n<li>Les taxes applicables seront retenues et remises.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>Modéré : Remboursement intégral 5 jours avant la date d\'arrivée, hors frais</strong></h3>\n\n<ul>\n<li>Les frais de ménage sont toujours remboursés si le client ne s\'est pas enregistré.</li>\n<li>Les frais de service Buy2rental ne sont pas remboursables.</li>\n<li>S\'il y a une plainte de l\'une ou l\'autre des parties, un avis doit être donné à Buy2rental&nbsp;dans les 24 heures suivant l\'enregistrement.</li>\n<li>Buy2rental arbitrera si nécessaire et aura le dernier mot dans tous les litiges.</li>\n<li>Une réservation est officiellement annulée lorsque le client clique sur le bouton d\'annulation sur la page de confirmation d\'annulation, qu\'il peut trouver dans le tableau de bord &gt ; Vos voyages &gt; Modifier ou annuler.</li>\n<li>Les politiques d\'annulation peuvent être remplacées par la politique de remboursement des invités, les annulations de sécurité ou des circonstances atténuantes. Veuillez consulter ces exceptions.</li>\n<li>Les taxes applicables seront retenues et remises.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>Strict : 50 % de remboursement jusqu\'à 1 semaine avant la date d\'arrivée, hors frais</strong></h3>\n\n<ul>\n<li>Les frais de ménage sont toujours remboursés si le client ne s\'est pas enregistré.</li>\n<li>Les frais de service Buy2rental ne sont pas remboursables.</li>\n<li>S\'il y a une plainte de l\'une ou l\'autre des parties, un avis doit être donné à Buy2rental dans les 24 heures suivant l\'enregistrement.</li>\n<li>Buy2rental arbitrera si nécessaire et aura le dernier mot dans tous les litiges.</li>\n<li>Une réservation est officiellement annulée lorsque le client clique sur le bouton d\'annulation sur la page de confirmation d\'annulation, qu\'il peut trouver dans le tableau de bord &gt ; Vos voyages &gt; Modifier ou annuler.</li>\n<li>Les politiques d\'annulation peuvent être remplacées par la politique de remboursement des invités, les annulations de sécurité ou des circonstances atténuantes. Veuillez consulter ces exceptions.</li>\n<li>Les taxes applicables seront retenues et remises.</li>\n</ul>\n</div>","second","Active","fr","4","2021-12-07 01:28:56","2021-12-07 02:41:16");
