\n\n<div class = \"cancellation_policy\">\n<p> & nbsp; </p>\n\n<p> Buy2rental позволяет хостам выбирать из трех стандартных политик отмены (гибкая, умеренная и строгая), которые мы будем применять для защиты как гостя, так и хоста. В каждом объявлении и бронировании на нашем сайте будет четко указана политика отмены. Гости могут отменить и просмотреть любые штрафы, просмотрев свои планы поездок и нажав кнопку «Отменить». по соответствующему бронированию. </p>\n\n<p> & nbsp; </p>\n\n<h3> <strong> Гибко: полный возврат средств за 1 день до прибытия, за исключением сборов </strong> </h3>\n\n<ul>\n<li> Плата за уборку всегда возвращается, если гость не прошел регистрацию. </li>\n<li> Плата за услугу Buy2rental не возвращается. </li>\n<li> Если есть жалоба от любой из сторон, уведомление должно быть отправлено Buy2rental в течение 24 часов после регистрации. </li>\n<li> Buy2rental выступит посредником, когда это необходимо, и последнее слово во всех спорах. </li>\n<li> Бронирование официально отменяется, когда гость нажимает кнопку отмены на странице подтверждения отмены, которую он может найти в Личном кабинете & gt; Ваши поездки & gt; Изменить или отменить. </li>\n<li> Политика отмены бронирования может быть заменена Политикой возврата гостя, отменой бронирования по соображениям безопасности или смягчающими обстоятельствами. Просмотрите эти исключения. </li>\n<li> Применимые налоги будут удерживаться и перечисляться. </li>\n</ul>\n\n<p> & nbsp; </p>\n\n<h3> <strong> Умеренно: полный возврат средств за 5 дней до прибытия, за исключением сборов </strong> </h3>\n\n<ul>\n<li> Плата за уборку всегда возвращается, если гость не прошел регистрацию. </li>\n<li> Плата за услугу Buy2rental не возвращается. </li>\n<li> Если есть жалоба от любой из сторон, уведомление должно быть отправлено Buy2rental & nbsp; в течение 24 часов после регистрации. </li>\n<li> Buy2rental выступит посредником, когда это необходимо, и последнее слово во всех спорах. </li>\n<li> Бронирование официально отменяется, когда гость нажимает кнопку отмены на странице подтверждения отмены, которую он может найти в Личном кабинете & gt; Ваши поездки & gt; Изменить или отменить. </li>\n<li> Политика отмены бронирования может быть заменена Политикой возврата гостя, отменой бронирования по соображениям безопасности или смягчающими обстоятельствами. Просмотрите эти исключения. </li>\n<li> Применимые налоги будут удерживаться и перечисляться. </li>\n</ul>\n\n<p> & nbsp; </p>\n\n<h3> <strong> Строгое: возврат 50% за 1 неделю до прибытия, за исключением сборов </strong> </h3>\n\n<ul>\n<li> Плата за уборку всегда возвращается, если гость не прошел регистрацию. </li>\n<li> Плата за услугу Buy2rental не возвращается. </li>\n<li> Если есть жалоба от любой из сторон, уведомление должно быть отправлено Buy2rental в течение 24 часов после регистрации. </li>\n<li> Buy2rental выступит посредником, когда это необходимо, и последнее слово во всех спорах. </li>\n<li> Бронирование официально отменяется, когда гость нажимает кнопку отмены на странице подтверждения отмены, которую он может найти в Личном кабинете & gt; Ваши поездки & gt; Изменить или отменить. </li>\n<li> Политика отмены бронирования может быть заменена Политикой возврата гостя, отменой бронирования по соображениям безопасности или смягчающими обстоятельствами. Просмотрите эти исключения. </li>\n<li> Применимые налоги будут удерживаться и перечисляться. </li>\n</ul>\n</div>","second","Active","ru","6","2021-12-07 01:28:56","2021-12-07 02:41:16");
\n\n<div class = \"cancelación_política\">\n<p> & nbsp; </p>\n\n<p> Buy2rental permite a los anfitriones elegir entre tres políticas de cancelación estandarizadas (Flexible, Moderada y Estricta) que aplicaremos para proteger tanto al huésped como al anfitrión. Cada listado y reserva en nuestro sitio indicará claramente la política de cancelación. Los huéspedes pueden cancelar y revisar cualquier penalización al ver sus planes de viaje y luego hacer clic en & # 39; Cancelar & # 39; en la reserva correspondiente. </p>\n\n<p> & nbsp; </p>\n\n<h3> <strong> Flexible: reembolso completo 1 día antes de la llegada, excepto tarifas </strong> </h3>\n\n<ul>\n<li> Las tarifas de limpieza siempre se reembolsan si el huésped no se registró. </li>\n<li> La tarifa del servicio Buy2rental no es reembolsable. </li>\n<li> Si hay una queja de cualquiera de las partes, se debe notificar a Buy2rental dentro de las 24 horas posteriores al registro. </li>\n<li> Buy2rental mediará cuando sea necesario y tiene la última palabra en todas las disputas. </li>\n<li> Una reserva se cancela oficialmente cuando el huésped hace clic en el botón de cancelación en la página de confirmación de cancelación, que puede encontrar en Panel de control & gt; Tus viajes & gt; Cambiar o cancelar. </li>\n<li> Las políticas de cancelación pueden ser reemplazadas por la Política de reembolso para huéspedes, cancelaciones de seguridad o circunstancias atenuantes. Revise estas excepciones. </li>\n<li> Los impuestos aplicables se retendrán y remitirán. </li>\n</ul>\n\n<p> & nbsp; </p>\n\n<h3> <strong> Moderado: reembolso completo 5 días antes de la llegada, excepto tarifas </strong> </h3>\n\n<ul>\n<li> Las tarifas de limpieza siempre se reembolsan si el huésped no se registró. </li>\n<li> La tarifa del servicio Buy2rental no es reembolsable. </li>\n<li> Si hay una queja de cualquiera de las partes, se debe notificar a Buy2rental & nbsp; dentro de las 24 horas posteriores al registro. </li>\n<li> Buy2rental mediará cuando sea necesario y tiene la última palabra en todas las disputas. </li>\n<li> Una reserva se cancela oficialmente cuando el huésped hace clic en el botón de cancelación en la página de confirmación de cancelación, que puede encontrar en Panel de control & gt; Tus viajes & gt; Cambiar o cancelar. </li>\n<li> Las políticas de cancelación pueden ser reemplazadas por la Política de reembolso para huéspedes, cancelaciones de seguridad o circunstancias atenuantes. Revise estas excepciones. </li>\n<li> Los impuestos aplicables se retendrán y remitirán. </li>\n</ul>\n\n<p> & nbsp; </p>\n\n<h3> <strong> Estricto: reembolso del 50% hasta 1 semana antes de la llegada, excepto tarifas </strong> </h3>\n\n<ul>\n<li> Las tarifas de limpieza siempre se reembolsan si el huésped no se registró. </li>\n<li> La tarifa del servicio Buy2rental no es reembolsable. </li>\n<li> Si hay una queja de cualquiera de las partes, se debe notificar a Buy2rental dentro de las 24 horas posteriores al registro. </li>\n<li> Buy2rental mediará cuando sea necesario y tiene la última palabra en todas las disputas. </li>\n<li> Una reserva se cancela oficialmente cuando el huésped hace clic en el botón de cancelación en la página de confirmación de cancelación, que puede encontrar en Panel de control & gt; Tus viajes & gt; Cambiar o cancelar. </li>\n<li> Las políticas de cancelación pueden ser reemplazadas por la Política de reembolso para huéspedes, cancelaciones de seguridad o circunstancias atenuantes. Revise estas excepciones. </li>\n<li> Los impuestos aplicables se retendrán y remitirán. </li>\n</ul>\n</div>","second","Active","es","7","2021-12-07 01:28:56","2021-12-07 02:41:16");
\n\n<div class=\"cancellation_policy\">\n<p>&nbsp;</p>\n\n<p>Buy2rental, ev sahiplerinin hem misafiri hem de ev sahibini aynı şekilde korumak için uygulayacağımız üç standartlaştırılmış iptal politikası (Esnek, Orta ve Katı) arasından seçim yapmasına olanak tanır. Sitemizdeki her kayıt ve rezervasyon, iptal politikasını açıkça belirtecektir. Misafirler, seyahat planlarını görüntüleyerek ve ardından \'İptal\'i tıklayarak cezaları iptal edebilir ve gözden geçirebilir; uygun rezervasyonda.</p>\n\n<p>&nbsp;</p>\n\n<h3><strong>Esnek: Ücretler hariç varıştan 1 gün önce tam geri ödeme</strong></h3>\n\n<ul>\n<li>Konuk giriş yapmadıysa temizlik ücretleri her zaman iade edilir.</li>\n<li>Buy2rental hizmet ücreti iade edilmez.</li>\n<li>Taraflardan herhangi birinin şikayeti varsa, check-in\'den sonraki 24 saat içinde Buy2rental\'e bildirilmelidir.</li>\n<li>Buy2rental gerektiğinde arabuluculuk yapacak ve tüm anlaşmazlıklarda son sözü söyleyecektir.</li>\n<li>Konuk, Kontrol Paneli &gt; Seyahatleriniz &gt; Değiştir veya İptal Et.</li>\n<li>İptal politikaları, Misafir Geri Ödeme Politikası, güvenlik iptalleri veya hafifletici nedenler tarafından geçersiz kılınabilir. Lütfen bu istisnaları inceleyin.</li>\n<li>Geçerli vergiler alıkonulacak ve havale edilecektir.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>Orta: Ücretler hariç, varıştan 5 gün önce tam geri ödeme</strong></h3>\n\n<ul>\n<li>Konuk giriş yapmadıysa temizlik ücretleri her zaman iade edilir.</li>\n<li>Buy2rental hizmet ücreti iade edilmez.</li>\n<li>Taraflardan herhangi birinin şikayeti varsa, check-in\'den sonraki 24 saat içinde Buy2rental&nbsp;\'e bildirilmelidir.</li>\n<li>Buy2rental gerektiğinde arabuluculuk yapacak ve tüm anlaşmazlıklarda son sözü söyleyecektir.</li>\n<li>Konuk, Kontrol Paneli &gt; Seyahatleriniz &gt; Değiştir veya İptal Et.</li>\n<li>İptal politikaları, Misafir Geri Ödeme Politikası, güvenlik iptalleri veya hafifletici nedenler tarafından geçersiz kılınabilir. Lütfen bu istisnaları inceleyin.</li>\n<li>Geçerli vergiler alıkonulacak ve havale edilecektir.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3><strong>Kesin: Ücretler hariç, varıştan 1 hafta öncesine kadar %50 geri ödeme</strong></h3>\n\n<ul>\n<li>Konuk giriş yapmadıysa temizlik ücretleri her zaman iade edilir.</li>\n<li>Buy2rental hizmet ücreti iade edilmez.</li>\n<li>Taraflardan herhangi birinin şikayeti varsa, check-in\'den sonraki 24 saat içinde Buy2rental\'e bildirilmelidir.</li>\n<li>Buy2rental gerektiğinde arabuluculuk yapacak ve tüm anlaşmazlıklarda son sözü söyleyecektir.</li>\n<li>Konuk, Kontrol Paneli &gt; Seyahatleriniz &gt; Değiştir veya İptal Et.</li>\n<li>İptal politikaları, Misafir Geri Ödeme Politikası, güvenlik iptalleri veya hafifletici nedenler tarafından geçersiz kılınabilir. Lütfen bu istisnaları inceleyin.</li>\n<li>Geçerli vergiler alıkonulacak ve havale edilecektir.</li>\n</ul>\n</div>","second","Active","tr","8","2021-12-07 01:28:56","2021-12-07 02:41:16");





